window.bookSummaryJSON = "<p><i>Feed</i> is an electrifying and critically acclaimed novel of a world a half-step from our own that the <i>New York Times</i> calls “Astonishing” a novel of zombies, geeks, politics, social media, and the virus that runs through them all&nbsp;- from <i>New York Times </i>best seller Mira Grant.</p> <p>The year was 2014. We had cured cancer. We had beat the common cold. But in doing so we created something new, something terrible that no one could stop. The infection spread, virus blocks taking over bodies and minds with one, unstoppable command: Feed.</p> <p>Now, 20 years after the Rising, Georgia, and Shaun Mason are on the trail of the biggest story of their lives - the dark conspiracy behind the infected. The truth will out, even if it kills them.</p> <p>More from Mira Grant:</p> <p><b>Newsflesh</b></p> <ul> <li><i>Feed</i></li> <li><i>Deadline</i></li> <li><i>Blackout</i></li> <li><i>Feedback</i></li> <li><i>Rise</i></li> </ul>"; 
